import React, { useState } from "react";
import { Dialog, DialogTitle, DialogContent, DialogActions, Button, TextField } from "@mui/material";

function NewProfileForm({ open, handleClose, addProfile }) {
  const [profileData, setProfileData] = useState({
    name: "",
    position: "",
    pastProjects: "",
    expertiseYears: "",
    technicalSkills: "",
  });

  const handleChange = (e) => {
    const { name, value } = e.target;
    setProfileData((prevData) => ({
      ...prevData,
      [name]: value,
    }));
  };

  const handleSubmit = () => {
    addProfile(profileData);
    handleClose();
  };

  return (
    <Dialog open={open} onClose={handleClose}>
      <DialogTitle>Add New Profile</DialogTitle>
      <DialogContent>
        <form>
          <TextField label="Name" name="name" value={profileData.name} onChange={handleChange} fullWidth />
          <TextField label="Position" name="position" value={profileData.position} onChange={handleChange} fullWidth />
          <TextField label="Past Projects" name="pastProjects" value={profileData.pastProjects} onChange={handleChange} fullWidth />
          <TextField label="Years of Expertise" name="expertiseYears" value={profileData.expertiseYears} onChange={handleChange} fullWidth />
          <TextField label="Technical Skills" name="technicalSkills" value={profileData.technicalSkills} onChange={handleChange} fullWidth />
        </form>
      </DialogContent>
      <DialogActions>
        <Button onClick={handleClose}>Cancel</Button>
        <Button onClick={handleSubmit} variant="contained" color="primary">
          Save
        </Button>
      </DialogActions>
    </Dialog>
  );
}

export default NewProfileForm;
